import React from 'react';
import ResultMap from './ResultMap';

const ResultsSection = ({ results }) => {
  if (!results) return null;

  const methodNames = {
    'arithmetic': 'Arithmetic Mean',
    'normal-ratio': 'Normal Ratio',
    'idw': 'Inverse Distance Weighting',
    'thiessen': 'Thiessen Polygon',
    'isohyetal': 'Isohyetal Method'
  };

  return (
    <div className="bg-white p-4 rounded-lg shadow space-y-6">
      <h2 className="text-xl font-bold">Results</h2>

      {/* Result Map */}
      <div className="relative">
        <ResultMap
          stations={results.stations}
          targetPoint={results.targetPoint}
          method={results.method}
          calculatedValue={results.value}
        />
      </div>

      {/* Results Details */}
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
        <div>
          <h3 className="font-semibold text-lg">Method</h3>
          <p className="text-gray-700">{methodNames[results.method]}</p>
        </div>

        <div>
          <h3 className="font-semibold text-lg">Target Point</h3>
          <p className="text-gray-700">
            Latitude: {results.targetPoint.lat.toFixed(6)}<br />
            Longitude: {results.targetPoint.lng.toFixed(6)}
          </p>
        </div>

        <div>
          <h3 className="font-semibold text-lg">Calculated Precipitation</h3>
          <p className="text-2xl font-bold text-blue-600">
            {results.value.toFixed(2)} mm
          </p>
        </div>

        <div>
          <h3 className="font-semibold text-lg">Method Description</h3>
          <p className="text-gray-700">
            {results.method === 'arithmetic' && 
              'Simple average of all station precipitation values.'}
            {results.method === 'normal-ratio' && 
              'Weighted average based on normal annual precipitation at each station.'}
            {results.method === 'idw' && 
              'Weighted average based on inverse distance from each station.'}
            {results.method === 'thiessen' && 
              'Area-weighted average using Thiessen polygons. Shows colored polygons representing each station\'s area of influence.'}
            {results.method === 'isohyetal' && 
              'Area-weighted average using interpolated contour lines. Shows isohyets (lines of equal precipitation) on the map.'}
          </p>
        </div>
      </div>

      {/* Stations Table */}
      <div>
        <h3 className="font-semibold text-lg mb-2">Stations Used</h3>
        <div className="max-h-40 overflow-y-auto">
          <table className="min-w-full divide-y divide-gray-200">
            <thead className="bg-gray-50">
              <tr>
                <th className="px-3 py-2 text-left text-xs font-medium text-gray-500 uppercase">Name</th>
                <th className="px-3 py-2 text-left text-xs font-medium text-gray-500 uppercase">Latitude</th>
                <th className="px-3 py-2 text-left text-xs font-medium text-gray-500 uppercase">Longitude</th>
                <th className="px-3 py-2 text-left text-xs font-medium text-gray-500 uppercase">Precipitation</th>
              </tr>
            </thead>
            <tbody className="bg-white divide-y divide-gray-200">
              {results.stations.map((station, index) => (
                <tr key={index}>
                  <td className="px-3 py-2 text-sm">{station.name || `Station ${index + 1}`}</td>
                  <td className="px-3 py-2 text-sm">{station.lat.toFixed(6)}</td>
                  <td className="px-3 py-2 text-sm">{station.lng.toFixed(6)}</td>
                  <td className="px-3 py-2 text-sm">{station.precipitation} mm</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default ResultsSection;
